import React from "react";

function Lookbook() {
  return (
    <div className="overview">
      <h2>
        Adidas officially announces its long-term partnership with Fear of God,
        led by owner and founder Jerry Lorenzo. With this groundbreaking
        partnership, Lorenzo will drive the creative and business strategy for
        adidas basketball globally. The alliance challenges and exists beyond
        traditional collaboration –– and is the truest and most honest form of
        both personal and business relationship. The partnership will also
        solidify the establishment and formation of the third pillar of the Fear
        of God house, Fear of God Athletics. The new pillar will focus on
        performance basketball and active lifestyle products that complete Fear
        of God’s triune nature and compliments the brand's other two pillars,
        Essentials and Fear of God’s luxury mainline.
        <br/> 
        “This is a role that is unprecedented in its very nature and nuanced attribution that it defies all titles and traditional definitions. This is a fearless move where shared vision and conviction are at the heart of the accretion of two brands shaping sports and culture, with the purpose to truly multiply our nuanced strengths to revolutionize the performance basketball industry forever.” says Jerry Lorenzo of Fear of God. “adidas and Fear of God share the same dream for the future of basketball, on and beyond the court, and we look forward to changing the face of the industry through a new model that will unfold before us in the coming years.”
      </h2>
    </div>
  );
}

export default Lookbook;
